import React, {Component} from 'react';
import PropTypes from 'prop-types';

class RenderTables extends Component {
    render() {
        return (
            <div>
                <div>
                    A1
                </div>
                <div>
                    A2
                </div>
                <div>
                    B1
                </div>
                <div>
                    A3
                </div>
                <div>
                    A4
                </div>
                <div>
                    B2
                </div>
            </div>

        );
    }
}

RenderTables.propTypes = {};

export default RenderTables;
